import React, { StrictMode } from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {
  ColorModeScript,
  colorModeScript
} from '@chakra-ui/react'


ReactDOM.render(
  <StrictMode>
    <ColorModeScript initialColorMode='light'/>
    <App />
  </StrictMode>,
  document.getElementById('root')
);
